On some machines this unit would fail due to a timing issue.  Since the Invoke in the loop was using nil as the param, it would (depending on timing) lead to the workers finishing the  (w *goWorkerWithFunc) run() in the range loop over w.args as args would == nil and return.

If an explicit time.Sleep(1 * time.Second) is added before the "	assert.EqualError(t, p.Invoke(nil), ErrPoolOverload.Error()," it is easily reproducible.","tree":{"sha":"6f34aa5a1e7780898cc7d426026f66edc911549f","url":"https://api.github.com/repos/panjf2000/ants/git/trees/6f34aa5a1e7780898cc7d426026f66edc911549f"},"url":"https://api.github.com/repos/panjf2000/ants/git/commits/ed8acad01e076caf712e3e985f0ec9676d108ffb","comment_count":0,"verification":{"verified":false,"reason":"unsigned","signature":null,"payload":null}},"url":"https://api.github.com/repos/panjf2000/ants/commits/ed8acad01e076caf712e3e985f0ec9676d108ffb","html_url":"https://github.com/panjf2000/ants/commit/ed8acad01e076caf712e3e985f0ec9676d108ffb","comments_url":"https://api.github.com/repos/panjf2000/ants/commits/ed8acad01e076caf712e3e985f0ec9676d108ffb/comments","author":{"login":"jdamick","id":12317,"node_id":"MDQ6VXNlcjEyMzE3","avatar_url":"https://avatars.githubusercontent.com/u/12317?v=4","gravatar_id":"","url":"https://api.github.com/users/jdamick","html_url":"https://github.com/jdamick","followers_url":"https://api.github.com/users/jdamick/followers","following_url":"https://api.github.com/users/jdamick/following{/other_user}","gists_url":"https://api.github.com/users/jdamick/gists{/gist_id}","starred_url":"https://api.github.com/users/jdamick/starred{/owner}{/repo}","subscriptions_url":"https://api.github.com/users/jdamick/subscriptions","organizations_url":"https://api.github.com/users/jdamick/orgs","repos_url":"https://api.github.com/users/jdamick/repos","events_url":"https://api.github.com/users/jdamick/events{/privacy}","received_events_url":"https://api.github.com/users/jdamick/received_events","type":"User","site_admin":false},"committer":null,"parents":[{"sha":"4b16a811165326723182488f21b22ea6761418f4","url":"https://api.github.com/repos/panjf2000/ants/commits/4b16a811165326723182488f21b22ea6761418f4","html_url":"https://github.com/panjf2000/ants/commit/4b16a811165326723182488f21b22ea6